INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'und',0,'<div id=\"info-column-1\" style=\"float: left; margin-right: 30px; max-width: 350px;\">\r\n<div class=\'front-article-subcontent\'><div class=\'front-subheader\'><a href=\"\" style=\"pointer-events: none; cursor: default;\">READ</a></div>\r\nWhat is “time of emergence”?</div>\r\n</div>\r\n\r\n<div id=\"info-column-2\" style=\"float: left; margin-right: 30px; max-width: 350px;\">\r\n<div class=\'front-article-subcontent\'><div class=\'front-subheader\'><a href=\"\" style=\"pointer-events: none; cursor: default;\">TOUR</a></div>\r\nView different ways to create customized climate change information.</div>\r\n</div>\r\n\r\n<div id=\"info-column-3\" style=\"float: left; margin-right: 30px; max-width: 350px;\">\r\n<div class=\'front-article-subcontent\'><div class=\'front-subheader\'><a style=\"\" href=\"/explore\">EXPLORE</a></div>\r\nCreate my own customized maps and charts.</div>\r\n</div>\r\n\r\n\r\n\r\n<div class=\'front-article-subcontent\'>\r\n<img id=\"epa-logo\" src=\"sites/all/themes/uwtv6zen/images/toe/epa_logo_vert_small.gif\" style=\"display:inline\"><img id=\"usace-logo\" src=\"sites/all/themes/uwtv6zen/images/toe/uwtoe_acoe_usace_logos.png\"><img id=\"cig-logo\" src=\"sites/all/themes/uwtv6zen/images/toe/CIG_logo_color_3_inch.jpg\" style=\"display:inline;\"><img id=\"usace-logo-2\" src=\"sites/default/files/USACE_ClimateChangeLogo_highres.jpg\" style=\"display: inline\">\r\n</div>\r\n\r\n\r\n<div class=\'front-article-subcontent\' id=\"welcome-acknowledgments\"><div  class=\'front-subheader\'>ACKNOWLEDGMENTS</div>\r\nThe Time of Emergence project is a product of the University of Washington Climate Impacts Group. Website and database design by University of Washington (Tacoma) Center for Data Sciences. This project is supported by U.S. Environmental Protection Agency Region 10 and the U.S. Army Corps of Engineers.</div>\r\n\r\n<div class=\'front-article-subcontent\' id=\"welcome-disclaimer\"><div  class=\'front-subheader\'>DISCLAIMER</div>\r\nThe data and maps in this tool illustrate the potential effects of climate change, not the exact location nor timing. The data, maps, and information are provided for informational purposes only, and should be used only for screening or reference purposes. This tool shall not be used to assess actual hazards, insurance requirements, property values, permitting, or other legal purposes. Any opinions, findings, conclusions expressed in this project are those of the Climate Impacts Group and do not necessarily reflect the views of the USEPA or USACE. The entire risk associated with the results and performance of these data is assumed by the user.</div>\r\n\r\n','','full_html'),('node','page',0,2,2,'und',0,'<p>First select a region:</p>\r\n<p><img src=\"sites/default/files/wamap.png\"></p>\r\n<p>Then select the visiualization:<br/>\r\n<a href=\"compare\">Compare multiple hydroclimatic variables in a single geographic domain</a><br/>\r\n<a href=\"\"  style=\"pointer-events: none; cursor: default;\">Explore the spatial variability of one hydro-climatic variable across a specific geographic domain</a></p>\r\n','','full_html'),('node','page',0,3,3,'und',0,'<!--<p>\r\nHydroclimatic variables will be show for region: <strong>King County</strong><br/>\r\nVisualization tool: <strong>Compare multiple hydroclimatic variables in a single geographic domain</strong>\r\n\r\nPlease refine query by choosing from options below. All fields are required.\r\n</p>-->\r\n<p>Define parameters for visualization.</p>','','full_html'),('node','webform',0,4,4,'und',0,'Webform one','','filtered_html'),('node','page',0,5,5,'und',0,'Please mark with \'DONE\' as appropriate\r\n\r\nAnika\r\n\r\nTimeline must look prettier - colors/time widths etc. Check with Abdeltawab for additional feedback as necessary.\r\nAdd a header to the theme.!! - Anika\r\nCenter/shrink county names on WA map on \'explore\' page \r\nTooltip not working on timeline in Chrome. \r\nVariable shortname stacked if timeline same TOE. \r\nChange read,tour,explore into three columns. Bigger text for these three items. Shrink acknowledgements/disclaimer text. Remove \'Partner\'s\' word. One logo missing. Two similar USACE logos(need both).\r\nAdd slightly different background color to \'title\' text like \'Explore\' on the \'/explore\'\' page. (silver or greay) explore/compare/ title.\r\nFront page logos evenly spaced horizontally. \r\nIn the timeline, alter the variable shortname so that is a link to the path \'/boxplot\'. \r\nThe form on the \'/compare\' page has two \'fieldsets\'.  Please alter .css so those fieldsets have one pixel borders using a color that matches the theme.\r\n\r\nDwaine\r\nDwaine to respond to Rita about multiple emission scenarios. - !!!!!!!\r\nRestore map to explore page (even if not yet cleaned up) - DONE\r\nChange submit button text (make appropriate for each page?) - DONE\r\nAdd instruction text to variables (press control for multiple....) - DONE\r\nGeographic domain can only select county, which then pops up the \'county\' dropdown. - DONE\r\nCompare/explore is first. Maybe selecting un-disables next option. Maybe next option appears after choice is made with first. - DONE\r\non \'compare\' all three disabled get \'all\' option. That option is preselected. - DONE\r\nMove these three into three columns. - DONE\r\n\'Selection of variables available.\' micht be test with variable. - What does this mean? I wrote this yet I cannot decipher it.\r\nHide three disabled on timeline - DONE\r\nRemove lower copy of three var text. - DONE\r\nin \'TOE range\' column: if year is over 2100 change to \'beyond 2100\' - DONE\r\nFix display of V8 and other: degree symbol instead of \'deg\'. - DONE\r\n\'dataset\' is not GCM, but look again at website text for \'BCSD\'. - DONE\r\non timeline page circle around king county graphic. Must be visual. - Anika or Dwaine\r\nget a \'boxplots\' page up. - DONE\r\nCan we add fieldset/border around form choices? YES, but the theme supresses fieldset borders. Moving border work to Anika. - DONE\r\n--more\r\nmove all to top of list. - DONE\r\nMake variable box bigger. Label it as \'Hydroclimatic Variables\' - DONE\r\nBoxplot static image is on onedrive.\r\nVariable name in table will link to boxplot. - DONE\r\nRead about box plot ideas on one drive. Use what is there to populate content of /boxplot page.\r\nUpdate query choice from second tab of lookup on one drive -- AND tab three\r\nReview onedrive copy of \'websitetextdoc.docx\' for upated verbiage.\r\nOffer help with header image if necessary.\r\n--last\r\nAdd popup from tab 3 of file on onedrive. . Mouseover image on form. - low priority.\r\nHeat Map (on new page) (is this phase 2?)\r\n\r\n','','filtered_html'),('node','page',0,6,6,'und',0,'Boxplot Stand in Content','','filtered_html');
